"DT_Output_3" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_3" AS t1
   LEFT OUTER JOIN
   "DT_node_data_3" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_4" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_3", t1."Leaf_5", t1."Leaf_8", t1."Leaf_12", t1."Leaf_13", t1."Leaf_14", t1."Leaf_15", t1."Leaf_17", t1."Leaf_18", t1."Leaf_22", t1."Leaf_27", t1."Leaf_28", t1."Leaf_29", t1."Leaf_30", t1."Leaf_36", t1."Leaf_37", t1."Leaf_38", t1."Leaf_43", t1."Leaf_44", t1."Leaf_45", t1."Leaf_46", t1."Leaf_47", t1."Leaf_50", t1."Leaf_51", t1."Leaf_52", t1."Leaf_56", t1."Leaf_57", t1."Leaf_58", t1."Leaf_62", t1."Leaf_63", t1."Leaf_64", t1."Leaf_65", t1."Leaf_72", t1."Leaf_73", t1."Leaf_75", t1."Leaf_76", t1."Leaf_77", t1."Leaf_78", t1."Leaf_83", t1."Leaf_84", t1."Leaf_85", t1."Leaf_86", t1."Leaf_87", t1."Leaf_89", t1."Leaf_90", t1."Leaf_97", t1."Leaf_98", t1."Leaf_100", t1."Leaf_102", t1."Leaf_106", t1."Leaf_107", t1."Leaf_108", t1."Leaf_109", t1."Leaf_111", t1."Leaf_112", t1."Leaf_113", t1."Leaf_115", t1."Leaf_116", t1."Leaf_119", t1."Leaf_120", t1."Leaf_121", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_6" <= -3.473968) AND (t."X_8" <= -0.186756)) THEN 3 ELSE NULL END AS "Leaf_3",
      CASE WHEN((t."X_6" <= -3.473968) AND (t."X_8" > -0.186756) AND (t."X_9" <= -1.894926)) THEN 5 ELSE NULL END AS "Leaf_5",
