 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_7" AS t1
   LEFT OUTER JOIN
   "DT_node_data_7" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_8" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_4", t1."Leaf_12", t1."Leaf_15", t1."Leaf_17", t1."Leaf_18", t1."Leaf_21", t1."Leaf_22", t1."Leaf_25", t1."Leaf_26", t1."Leaf_27", t1."Leaf_34", t1."Leaf_35", t1."Leaf_36", t1."Leaf_37", t1."Leaf_38", t1."Leaf_41", t1."Leaf_42", t1."Leaf_46", t1."Leaf_47", t1."Leaf_49", t1."Leaf_50", t1."Leaf_56", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_61", t1."Leaf_62", t1."Leaf_63", t1."Leaf_65", t1."Leaf_66", t1."Leaf_69", t1."Leaf_71", t1."Leaf_73", t1."Leaf_74", t1."Leaf_75", t1."Leaf_76", t1."Leaf_77", t1."Leaf_79", t1."Leaf_80", t1."Leaf_81", t1."Leaf_82", t1."Leaf_87", t1."Leaf_88", t1."Leaf_90", t1."Leaf_93", t1."Leaf_96", t1."Leaf_97", t1."Leaf_99", t1."Leaf_100", t1."Leaf_101", t1."Leaf_103", t1."Leaf_104", t1."Leaf_106", t1."Leaf_109", t1."Leaf_111", t1."Leaf_112", t1."Leaf_117", t1."Leaf_118", t1."Leaf_120", t1."Leaf_121", t1."Leaf_122", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_8" > 0.018814) AND (t."X_7" > 0.304290)) THEN 4 ELSE NULL END AS "Leaf_4",
      CASE WHEN((t."X_8" <= 0.018814) AND (t."X_1" > -0.147366) AND (t."X_7" <= 0.056240) AND (t."X_8" > -0.066979)) THEN 12 ELSE NULL END AS "Leaf_12",
      CASE WHEN((t."X_8" > 0.018814) AND (t."X_7" <= 0.304290) AND (t."X_1" > -0.467085) AND (t."X_1" <= -0.385283) AND (t."X_1" <= -0.416936)) THEN 15 ELSE NULL END AS "Leaf_15",
      CASE WHEN((t."X_8" > 0.018814) AND (t."X_7" <= 0.304290) AND (t."X_1" > -0.467085) AND (t."X_1" <= -0.385283) AND (t."X_1" > -0.416936) AND (t."X_9" <= -0.337976)) THEN 17 ELSE NULL END AS "Leaf_17",
