      CASE WHEN((t."X_7" > 0.088553) AND (t."X_6" > 0.394135) AND (t."X_7" <= 2.299074) AND (t."X_8" > -1.176725) AND (t."X_0" > 0.433537) AND (t."X_0" > 2.667336)) THEN 12 ELSE NULL END AS "Leaf_12",
