   "DT_node_lookup_28" AS t1
   LEFT OUTER JOIN
   "DT_node_data_28" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_29" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_3", t1."Leaf_4", t1."Leaf_8", t1."Leaf_15", t1."Leaf_17", t1."Leaf_18", t1."Leaf_20", t1."Leaf_21", t1."Leaf_23", t1."Leaf_24", t1."Leaf_25", t1."Leaf_28", t1."Leaf_29", t1."Leaf_30", t1."Leaf_32", t1."Leaf_33", t1."Leaf_34", t1."Leaf_41", t1."Leaf_43", t1."Leaf_44", t1."Leaf_46", t1."Leaf_51", t1."Leaf_52", t1."Leaf_53", t1."Leaf_54", t1."Leaf_56", t1."Leaf_58", t1."Leaf_59", t1."Leaf_63", t1."Leaf_64", t1."Leaf_65", t1."Leaf_66", t1."Leaf_67", t1."Leaf_69", t1."Leaf_71", t1."Leaf_72", t1."Leaf_75", t1."Leaf_78", t1."Leaf_79", t1."Leaf_80", t1."Leaf_83", t1."Leaf_87", t1."Leaf_88", t1."Leaf_91", t1."Leaf_92", t1."Leaf_93", t1."Leaf_97", t1."Leaf_98", t1."Leaf_99", t1."Leaf_101", t1."Leaf_102", t1."Leaf_105", t1."Leaf_109", t1."Leaf_111", t1."Leaf_114", t1."Leaf_115", t1."Leaf_116", t1."Leaf_117", t1."Leaf_119", t1."Leaf_120", t1."Leaf_122", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_0" > 2.765871) AND (t."X_8" <= -0.470388)) THEN 3 ELSE NULL END AS "Leaf_3",
      CASE WHEN((t."X_0" > 2.765871) AND (t."X_8" > -0.470388)) THEN 4 ELSE NULL END AS "Leaf_4",
      CASE WHEN((t."X_0" <= 2.765871) AND (t."X_7" > 0.095555) AND (t."X_8" > -0.138308)) THEN 8 ELSE NULL END AS "Leaf_8",
      CASE WHEN((t."X_0" <= 2.765871) AND (t."X_7" > 0.095555) AND (t."X_8" <= -0.138308) AND (t."X_7" <= 0.823698) AND (t."X_8" > -1.491246) AND (t."X_8" > -0.710158) AND (t."X_9" <= -0.019918)) THEN 15 ELSE NULL END AS "Leaf_15",
